CREATE DATABASE /*!32312 IF NOT EXISTS*/`tunipharma` /*!40100 DEFAULT CHARACTER SET utf8 COLLATE utf8_bin */;

USE `tunipharma`;

/*Table structure for table `pharmacie` */

DROP TABLE IF EXISTS `pharmacie`;

CREATE TABLE `pharmacie` (
  `ID` int(10) NOT NULL AUTO_INCREMENT,
  `nom` varchar(30) COLLATE utf8_bin NOT NULL,
  `adresse` varchar(50) COLLATE utf8_bin NOT NULL,
  `codepostal` int(4) NOT NULL,
  `type` varchar(20) COLLATE utf8_bin NOT NULL,
  `etat` varchar(20) COLLATE utf8_bin NOT NULL,
  `numtel` varchar(20) COLLATE utf8_bin DEFAULT NULL,
  `email` varchar(30) COLLATE utf8_bin DEFAULT NULL,
  `log` double(10,10) DEFAULT NULL,
  `lat` double(10,10) DEFAULT NULL,
  `pharmacien` int(10) NOT NULL,
  PRIMARY KEY (`ID`),
  KEY `fk_pharmacien` (`pharmacien`),
  KEY `fk_codepostal` (`codepostal`),
  CONSTRAINT `fk_pharmacien` FOREIGN KEY (`pharmacien`) REFERENCES `pharmacien` (`ref`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_codepostal` FOREIGN KEY (`codepostal`) REFERENCES `villes` (`codepostal`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

